tables.table_schema:
CREATE TABLE model_configurations (
    id INT PRIMARY KEY,
    model_name VARCHAR(255),
    configuration_json JSONB
);

CREATE TABLE model_parameters (
    id INT PRIMARY KEY,
    model_id INT,
    parameter_name VARCHAR(255),
    parameter_value FLOAT
);

CREATE TABLE model_logs (
    log_id INT PRIMARY KEY,
    model_id INT,
    log_message TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE ai_model_configurations (
    id INT PRIMARY KEY,
    model_name VARCHAR(255),
    creator_name VARCHAR(255),
    creation_date TIMESTAMP
);

CREATE TABLE model_parameters (
    id INT PRIMARY KEY,
    parameter_name VARCHAR(255),
    parameter_value FLOAT,
    description TEXT
);

CREATE TABLE model_logs (
    id INT PRIMARY KEY,
    log_date TIMESTAMP,
    log_message TEXT
);

CREATE TABLE ai_models (
    model_id UUID PRIMARY KEY,
    model_name TEXT NOT NULL,
    model_description TEXT,
    created_at TIMESTAMP NOT NULL
);

CREATE TABLE model_parameters (
    param_id UUID PRIMARY KEY,
    model_id UUID REFERENCES ai_models (model_id),
    param_name TEXT NOT NULL,
    param_value TEXT NOT NULL
);

CREATE TABLE hyperparameters (
    hyperparam_id UUID PRIMARY KEY,
    param_id UUID REFERENCES model_parameters (param_id),
    hyperparam_name TEXT NOT NULL,
    hyperparam_value TEXT NOT NULL
);

CREATE TABLE training_data (
    data_id UUID PRIMARY KEY,
    model_id UUID REFERENCES ai_models (model_id),
    data_description TEXT NOT NULL
);

CREATE TABLE evaluation_metrics (
    metric_id UUID PRIMARY KEY,
    model_id UUID REFERENCES ai_models (model_id),
    metric_name TEXT NOT NULL,
    metric_value FLOAT NOT NULL
);
